import todoModel from "../model/todo.model";

export const addTodo = async (req, res) =>{
    try {
        const addData = new todoModel(req.body)
        const addTodoData = await addData.save();
        
        if(addTodoData){
            res.status(200).json({
                data:addTodoData,
                message:"Todo added Successfully"
            })
        }else{
            res.status(400).json({
                message:"Cannot add todo"
            })
        }
    } catch (error) {
        res.status(500).json({
            message:`Server Error: ${error.message}`
        })
    }
}

export const getTodo = async (req, res) =>{
    try {
        const getTodoData = await todoModel.find();
        if(getTodoData){
            res.status(200).json({
                data:getTodoData,
                message:"Data fetched Successfully"
            })
        }else{
            res.status(400).json({
                message:"Cannot fetch data"
            })
        }
    } catch (error) {
        res.status(500).json({
            data:`Server Error: ${error.message}`
        })
    }
}

export const getSingleTodo = async (req, res) =>{
    try {
        const todoID = req.params.todoID
        const getTodoData = await todoModel.findOne({_id:todoID});
        if(getTodoData){
            res.status(200).json({
